def __init__(self, values, freq=None, dtype=None, copy=False):
    freq = validate_dtype_freq(dtype, freq)

    if freq is not None:
        freq = Period._maybe_convert_freq(freq)

    if isinstance(values, ABCSeries):
        values = values._values
        if not isinstance(values, type(self)):
            raise TypeError("Incorrect dtype")

    elif isinstance(values, ABCPeriodIndex):
        values = values._values

    if isinstance(values, type(self)):
        if freq is not None and freq != values.freq:
            raise raise_on_incompatible(values, freq)
        values, freq = values._data, values.freq

    values = np.array(values, dtype="int64", copy=copy)
    self._data = values
    if freq is None:
        raise ValueError("freq is not specified and cannot be inferred")
    self._dtype = PeriodDtype(freq)

@classmethod
def _simple_new(cls, values, freq=None, **kwargs):
    # alias for PeriodArray.__init__
    return cls(values, freq=freq, **kwargs)

@classmethod
def _from_sequence(
    cls,
    scalars: Sequence[Optional[Period]],
    dtype: Optional[PeriodDtype] = None,
    copy: bool = False,
) -> ABCPeriodArray:
    if dtype:
        freq = dtype.freq
    else:
        freq = None

    if isinstance(scalars, cls):
        validate_dtype_freq(scalars.dtype, freq)
        if copy:
            scalars = scalars.copy()
        return scalars

    periods = np.asarray(scalars, dtype=object)
    if copy:
        periods = periods.copy()

    freq = freq or libperiod.extract_freq(periods)
    ordinals = libperiod.extract_ordinals(periods, freq)
    return cls(ordinals, freq=freq)

@classmethod
def _from_sequence_of_strings(cls, strings, dtype=None, copy=False):
    return cls._from_sequence(strings, dtype, copy)

@classmethod
def _generate_range(cls, start, end, periods, freq, fields):
    periods = dtl.validate_periods(periods)

    if freq is not None:
        freq = Period._maybe_convert_freq(freq)

    field_count = len(fields)
    if start is not None or end is not None:
        if field_count > 0:
            raise ValueError(
                "Can either instantiate from fields or endpoints, but not both"
            )
        subarr, freq = _get_ordinal_range(start, end, periods, freq)
    elif field_count > 0:
        subarr, freq = _range_from_fields(freq=freq, **fields)
    else:
        raise ValueError("Not enough parameters to construct Period range")

    return subarr, freq

def _unbox_scalar(self, value: Union[Period, NaTType]) -> int:
    if value is NaT:
        return value.value
    elif isinstance(value, self._scalar_type):
        if not isna(value):
            self._check_compatible_with(value)
        return value.ordinal
    else:
        raise ValueError(f"'value' should be a Period. Got '{value}' instead.")

def _check_compatible_with(self, other, setitem: bool = False):
    if other is NaT:
        return
    if self.freqstr != other.freqstr:
        raise raise_on_incompatible(self, other)

@cache_readonly
def dtype(self):
    return self._dtype

@property  # type: ignore
def freq(self):
    """
    Return the frequency object for this PeriodArray.
    """
    return self.dtype.freq

def __array__(self, dtype=None):
    # overriding DatetimelikeArray
    return np.array(list(self), dtype=object)

@property
def is_leap_year(self):
    """
    Logical indicating if the date belongs to a leap year.
    """
    return isleapyear_arr(np.asarray(self.year))

@property
def start_time(self):
    return self.to_timestamp(how="start")

@property
def end_time(self):
    return self.to_timestamp(how="end")

@Appender(dtl.DatetimeLikeArrayMixin._validate_fill_value.__doc__)
def _validate_fill_value(self, fill_value):
    if isna(fill_value):
        fill_value = iNaT
    elif isinstance(fill_value, Period):
        self._check_compatible_with(fill_value)
        fill_value = fill_value.ordinal
    else:
        raise ValueError(f"'fill_value' should be a Period. Got '{fill_value}'.")
    return fill_value

@property
def _box_func(self):
    return lambda x: Period._from_ordinal(ordinal=x, freq=self.freq)

def _formatter(self, boxed=False):
    if boxed:
        return str
    return "'{}'".format

def astype(self, dtype, copy=True):
    # We handle Period[T] -> Period[U]
    # Our parent handles everything else.
    dtype = pandas_dtype(dtype)

    if is_period_dtype(dtype):
        return self.asfreq(dtype.freq)
    return super().astype(dtype, copy=copy)

def _sub_datelike(self, other):
    assert other is not NaT
    return NotImplemented

def _add_offset(self, other):
    assert not isinstance(other, Tick)
    base = libfrequencies.get_base_alias(other.rule_code)
    if base != self.freq.rule_code:
        raise raise_on_incompatible(self, other)

    # Note: when calling parent class's _add_timedeltalike_scalar,
    #  it will call delta_to_nanoseconds(delta).  Because delta here
    #  is an integer, delta_to_nanoseconds will return it unchanged.
    result = super()._add_timedeltalike_scalar(other.n)
    return type(self)(result, freq=self.freq)
